import Box from "@mui/material/Box";
import * as React from "react";
import "./style-ping.css";
import List from "@mui/material/List";

export default function PingDummy({ urlData }) {
	return (
		<>
			<Box className="resultsBox">
				<Box>
					{urlData.map((elem) => (
						<List key={elem.url}>
							{" "}
							<span>
								{" "}
								<h1>alo</h1>
								{elem.count} - {elem.url}
							</span>
						</List>
					))}
				</Box>
			</Box>
		</>
	);
}
